import "./Input.css";

const Input = ({ placeholder, type, timeInput }) => {
  return (
    <input 
      className="Default-input"
      placeholder={placeholder}
      type="number"
      max="59"
      min="1"
      maxLength="2"
      name={type}
      value={timeInput}
      pattern="\d*"
      type="tel"
    />
  );
};

export default Input;
